export const FETCH_BLOGS_SUCCESS = 'FETCH_BLOGS_SUCCESS';
export const FETCH_BLOGS_PENDING = 'FETCH_BLOGS_PENDING';
export const FETCH_BLOGS_ERROR= 'FETCH_BLOGS_ERROR';

export function fetchBlogs (value) {
    return ({type: FETCH_BLOGS_SUCCESS, value} , {type: FETCH_BLOGS_PENDING , value} , {FETCH_BLOGS_ERROR ,value})
}
